// Footer.js

import React from 'react';
import '../footer/Footer';

const Footer = () => {

  var d = new Date();
  const year = d.getFullYear();

  return (
    <footer>
      <div className="footer-content">
        <p> copyright &copy; year TabooTales. All rights reserved.</p>
      </div>
    </footer>
  );
};

export default Footer;
